import React from 'react';
import './header.scss';
const logo = require('../../assets/silontong.png');
const Header = () => {
	return (
		<div className="header">
			<div className="outline-logo">
				<img src={logo} alt="logo" className="logo" />
			</div>
		</div>
	);
};

export default Header;
